// App.jsx
import React, { useRef, useState, useEffect } from 'react';
import * as tf from '@tensorflow/tfjs';
import './App.css';

function App() {
  const videoRef = useRef(null);
  const canvasRef = useRef(null);

  const [model, setModel] = useState(null);
  const [predictions, setPredictions] = useState({ age: null, gender: null });
  const [isLoading, setIsLoading] = useState(false);
  const [cameraActive, setCameraActive] = useState(false);
  const [modelLoading, setModelLoading] = useState(true);
  const [capturedImage, setCapturedImage] = useState(null);
  const [latency, setLatency] = useState(null);
  const [selectedModel, setSelectedModel] = useState('resnet34');
  const [modelLoadTime, setModelLoadTime] = useState(null);

  useEffect(() => {
    let isMounted = true;

    const loadModel = async () => {
      setModelLoading(true);
      const startLoadTime = performance.now();
      const modelPath = `/model/${selectedModel}/model.json`;

      try {
        const loadedModel = await tf.loadLayersModel(modelPath);

        if (model) {
          try {
            model.dispose();
          } catch (err) {
            console.error('Error disposing previous model:', err);
          }
        }

        const endLoadTime = performance.now();
        const loadTime = (endLoadTime - startLoadTime).toFixed(2);

        if (isMounted) {
          setModel(loadedModel);
          setModelLoadTime(loadTime);
          setModelLoading(false);
        } else {
          loadedModel.dispose();
        }
      } catch (err) {
        console.error(`Error loading ${selectedModel} model:`, err);
        setModelLoading(false);
      }
    };

    loadModel();

    return () => {
      isMounted = false;
    };
  }, [selectedModel]);

  const handleModelChange = (e) => {
    setSelectedModel(e.target.value);
    setPredictions({ age: null, gender: null });
    setLatency(null);
  };

  const startCamera = async () => {
    try {
      const constraints = {
        video: {
          facingMode: { ideal: 'user' },
          width: { ideal: 640 },
          height: { ideal: 480 },
        },
        audio: false,
      };

      const stream = await navigator.mediaDevices.getUserMedia(constraints);

      if (videoRef.current) {
        videoRef.current.srcObject = stream;
        await videoRef.current.play();
        setCameraActive(true);
      }
    } catch (err) {
      console.error('Camera access error:', err);
      setCameraActive(false);
      alert(`Camera error: ${err.message}`);
    }
  };

  const stopCamera = () => {
    if (videoRef.current && videoRef.current.srcObject) {
      videoRef.current.srcObject.getTracks().forEach((track) => track.stop());
      videoRef.current.srcObject = null;
      setCameraActive(false);
    }
  };

  useEffect(() => {
    startCamera();
    return () => stopCamera();
  }, []);

  const captureImage = () => {
    if (!videoRef.current || !canvasRef.current) return;
    if (!model || modelLoading) {
      alert('Model not ready');
      return;
    }

    const canvas = canvasRef.current;
    const video = videoRef.current;
    const ctx = canvas.getContext('2d');

    canvas.width = video.videoWidth;
    canvas.height = video.videoHeight;
    ctx.drawImage(video, 0, 0, canvas.width, canvas.height);
    setCapturedImage(canvas.toDataURL('image/jpeg'));

    setTimeout(() => processImage(canvas), 50);
  };

  const processImage = async (canvas) => {
    setIsLoading(true);
    const startPredictionTime = performance.now();
    try {
      if (!model) throw new Error('Model not loaded');
      const ctx = canvas.getContext('2d');
      const imgData = ctx.getImageData(0, 0, canvas.width, canvas.height);
      const tensor = tf.browser
        .fromPixels(imgData)
        .resizeBilinear([224, 224])
        .toFloat()
        .div(tf.scalar(255))
        .expandDims(0);

      const result = await model.predict(tensor);
      const [ageTensor, genderTensor] = result;
      const age = (await ageTensor.data())[0];
      const genderProb = (await genderTensor.data())[0];

      const endTime = performance.now();
      const predictionTime = endTime - startPredictionTime;
      setLatency(predictionTime.toFixed(2));

      setPredictions({
        age: Math.round(age),
        gender: genderProb > 0.5 ? 'Female' : 'Male',
      });

      tensor.dispose();
      ageTensor.dispose();
      genderTensor.dispose();
    } catch (err) {
      console.error('Prediction error:', err);
      alert(`Error: ${err.message}`);
      resetCapture();
    } finally {
      setIsLoading(false);
    }
  };

  const resetCapture = async () => {
    setCapturedImage(null);
    setPredictions({ age: null, gender: null });
    setLatency(null);
    await startCamera();
  };

  return (
    <div className="app">
      {modelLoading && <div className="loading-overlay">Loading model...</div>}

      <h1>Age & Gender Predictor</h1>

      <div>
        <label>
          <input
            type="radio"
            value="resnet34"
            checked={selectedModel === 'resnet34'}
            onChange={handleModelChange}
            disabled={isLoading}
          />
          ResNet-34
        </label>

        <label>
          <input
            type="radio"
            value="resnet152"
            checked={selectedModel === 'resnet152'}
            onChange={handleModelChange}
            disabled={isLoading}
          />
          ResNet-152
        </label>
      </div>

      <div>
        {!capturedImage ? (
          <video ref={videoRef} autoPlay muted playsInline style={{ width: '100%' }} />
        ) : (
          <img src={capturedImage} alt="Captured" />
        )}
        <canvas ref={canvasRef} style={{ display: 'none' }} />
      </div>

      <div>
        {!capturedImage ? (
          <button onClick={captureImage} disabled={!cameraActive || modelLoading || isLoading}>
            Capture Image
          </button>
        ) : (
          <button onClick={resetCapture} disabled={isLoading}>
            Retake Photo
          </button>
        )}
      </div>

      <div>
        {isLoading ? (
          <p>Processing...</p>
        ) : predictions.age !== null ? (
          <div>
            <p>Age: {predictions.age}</p>
            <p>Gender: {predictions.gender}</p>
            <p>Latency: {latency} ms</p>
            <p>Model Load Time: {modelLoadTime} ms</p>
          </div>
        ) : (
          <p>No predictions yet</p>
        )}
      </div>
    </div>
  );
}

export default App;
